    false,nt"url": null,nt"notes": "Monthly tabulated index of the North Atlantic
    Oscillation (NAO) teleconnection pattern. The data spans the period 1950 to present.
    The index is derived from a rotated principal component analysis (RPCA) of normalized
    500-hPa height anomalies from the period 1950-2000. The data source is the NCEP/NCAR
    Reanalysis. The resulting time series is then re-normalized to coincide with the
    1981-2010 base period monthly means. The index is updated monthly. Calculating the
    NAO index using the RPCA approach is a somewhat complicated process, in that the
    NAO index is not derived independently of the other extra tropical teleconnection
    pattern indices.",nt"license_title": "License Not Specified",nt"extras":
